parsing:
  patterns:
    monthly:
    - ^\d{4}[-/]\d{2}$
    - ^(jan|feb|mar|apr|may|jun|jul|aug|sep|oct|nov|dec)[a-z]*\s+\d{4}$
    quarterly:
    - ^\d{4}-Q[1-4]$
    - ^(Q[1-4]|[1-4]Q)\s*\d{4}$
    yearly:
    - ^\d{4}$
    - ^(FY|CY)\d{2,4}$
    ytd:
    - ^YTD\s+\d{4}-\d{2}$
    - ^YTD\s+(jan|feb|mar|apr|may|jun|jul|aug|sep|oct|nov|dec)[a-z]*[-\s]*\d{2,4}$
validation:
  strict_alias_uniqueness: true
  unknown_period_action: log
cleaning:
  remove_prefixes:
  - 'period:'
  - 'pd:'
  - 'time:'
  normalize_whitespace: true
  normalize_punctuation:
    "\u2013": '-'
    "\u2014": '-'
  case_insensitive: true
